import styles from "./Navigation.module.css";
const Navigation = () => {
  return (
    <header>
      <nav>
        <ul>
          <li>Logo</li>
          <li>Login</li>
          <li>My Orders</li>
          <li>My Profile</li>
          <li>Store</li>
          <li>Cart</li>
        </ul>
      </nav>
    </header>
  );
};

export default Navigation;
